export default function TaskList({ title, tasks }) {
    // const categories = ['To DO', 'In Progress', 'Done'];
  handleEditTask = (e) =>{
    console.log("Editing Task:", e.target.innerText);
  }
    return (
    <div>
        <h2>{title}</h2>
     {tasks.map((task, index) => (
       <div key={index}>
         <h3 onClick={(e)=> handleEditTask(e)}>{task.id}</h3>

       </div>
     ))}    
    </div>
  );
}
